sys_variable_value.value:
(function execute(inputs, outputs) {
 var notify = new sn_notify.NotifyScoped();
 var from = '+12253963290';
 var to = inputs["to"];
 new notify.sendSMS(from, to, 'Hi '+ inputs["patientName"]+", "+'\n'+ 'Your total bill to be paid :  '+'\n' + 'Hosital Bill : '+ inputs["hospitalBill"] + "\n"+'Diagnostic Bill : ' + inputs["diagnosticBill"] + "\n" + 'Pharmacy Bill : ' + inputs["pharmacyBill"] + "\n"+ 'Total Bill : ' + inputs["totalBill"]);
})(inputs, outputs);

